text:
שיכולה לעמוד מול מרד של הצבא, המשטרה, והשב"כ; מול שיתוק מערכת הבריאות; השבתת המגזר העסקי; השבתת המגזר הפיננסי; לחץ של גורמים בינלאומיים; וכל זה כשאנרכיה משתוללת ברחובות ואין מי שמנסה לעצור אותה, אלא להפך.

המשמעות היא שהכל נגמר.
אין בישראל דמוקרטיה ולא מראית עין של דמוקרטיה &gt;&gt;&gt;

ברכות לאחינו, אנשי העליונות הלבנה.
שוב ניצחתם, כצפוי - הצלחתם לשמר את שלטונכם האבסולוטי במדינת ישראל, ובכך להגן על הדמוקרטיה -
דמוקרטיה שבה הבחירות הן למראית עין בלבד, ואין להן כל משמעות מעשית;
דמוקרטיה שבה המילה האחרונה מסורה תמיד לבית המשפט, שאין עליו שום איזונים או בלמים, &gt;&gt;

המתקפה של רה"מ נתניהו נגד מינוי השופטים בביהמ"ש העליון: "הגיע הזמן לשים סוף לשיטת 'חבר מביא חבר' בבית המשפט. לשופטים יש וטו על מינוי השופטים ובפועל הם ממנים את עצמם. זה לא קורה בשום דמוקרטיה אחרת בעולם"

#המהדורה_המרכזית
@MaggieTabibi @sharongal @netanyahu https://t.co/dRvybMPTdK

אנחנו נשליך את ביבי והמטורללים שלו לפח האשפה של ההיסטוריה - וזה מתחיל, בין היתר, בלהשליך את הפרקים שעשיתי איתו לפח האשפה של 'עושים היסטוריה'. אז כמה עשרות שעות של עבודה ירדו לטימיון? למי אכפת. נלחמים על הבית!
רן
(נ.ב. - כל האמור לעיל זו דעתי האישית בלבד, ולא משקפת בהכרח -&gt;

@amit_segal שים את האצבע על הנקודה הכי חשובה:
הממשלה הצליחה במו ידיה להעיף את "רק לא ביבי" מהשולחן ולגרום למתנגדי הממשלה להתאחד סביב משהו מהותי עם ערכים... דמוקרטיה.

על הדרך הצליחה להציף את כל מה שהם הדחיקו כל השנים כמו החוסר שוויון בנטל...
